9. Наниматель имеет право:
9.1. расторгнуть настоящий трудовой договор в порядке и по основаниям, установленным Трудовым кодексом Республики Беларусь и законодательными актами;
9.2. поощрять Работника;
9.3. требовать от Работника выполнения условий трудового договора и правил внутреннего трудового распорядка;
9.4. привлекать Работника к дисциплинарной и материальной ответственности в порядке, установленном Трудовым кодексом Республики Беларусь;
9.5. обращаться в суд для защиты своих прав.
10. Наниматель обязан:
10.1. организовать труд Работника;
10.2. рационально использовать труд Работника;
10.3. обеспечивать трудовую и производственную дисциплину;
10.4. вести учет фактически отработанного Работником времени;
10.5. выдавать Работнику заработную плату в сроки и размерах, установленных законодательством, коллективным договором, соглашением или настоящим трудовым договором;
10.6. обеспечивать здоровые и безопасные условия труда на каждом рабочем месте, соблюдать установленные нормативными правовыми актами требования по охране труда и предоставлять гарантии и компенсации за работу с вредными и (или) опасными условиями труда. При отсутствии в нормативных правовых актах требований, обеспечивающих безопасные условия труда, Наниматель принимает меры по обеспечению здоровых и безопасных условий труда;
10.7. принимать необходимые меры по профилактике производственного травматизма, профессиональных и других заболеваний Работника; постоянно контролировать знание и соблюдение Работником требований инструкций по охране труда и пожарной безопасности; своевременно и правильно проводить расследование и учет несчастных случаев на производстве;
10.8. в случаях, предусмотренных законодательством и локальными нормативными правовыми актами, своевременно предоставлять гарантии и компенсации в связи с вредными и (или) опасными условиями труда (сокращенный рабочий день, дополнительные отпуска, лечебно-профилактическое питание и др.); соблюдать нормы по охране труда женщин, молодежи и инвалидов;
10.9. обеспечивать Работника в соответствии с установленными нормами специальной одеждой, специальной обувью и другими средствами индивидуальной защиты, организовывать надлежащее хранение и уход за этими средствами;
10.10. обеспечивать соблюдение законодательства о труде, условий, установленных коллективными договорами, соглашениями, другими локальными нормативными правовыми актами и настоящим трудовым договором;
10.11. своевременно оформлять изменения в трудовых обязанностях Работника и знакомить его с ними;
10.12. обеспечивать повышение квалификации или переподготовку Работника;
10.13. создавать необходимые условия для совмещения работы с обучением в соответствии с Трудовым кодексом Республики Беларусь;

10.14. обеспечивать участие Работника в управлении организацией, своевременно рассматривать критические замечания Работника и сообщать ему о принятых мерах;
10.15. представлять статистические данные о труде в объеме и порядке, определенных законодательством;
10.16. оформлять изменения условий и прекращение настоящего трудового договора с Работником приказом (распоряжением);
10.17. отстранять Работника от работы в случаях, предусмотренных Трудовым кодексом Республики Беларусь и законодательством;
10.171. создавать Работнику необходимые условия для соблюдения установленного режима коммерческой тайны;
10.18. исполнять другие обязанности, вытекающие из законодательства, локальных нормативных правовых актов и настоящего трудового договора.
